// frontend/src/App.js

import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// Login
import IntroPage from "./components/IntroPage";

// Core Pages
import PlayerPicksPage from "./components/PlayerPicksPage";
import PlaceYourPicks from "./components/PlaceYourPicks";
import PrintableGamesPage from "./components/PrintableGamesPage";
import ResultsPage from "./components/ResultsPage";
import ViewScoresPage from "./components/ViewScoresPage";
import ChatPage from "./components/ChatPage";

// Admin Tools
import AdminUploadTool from "./components/AdminUploadTool";
import AdminApproveGamesPage from "./components/AdminApproveGamesPage";
import AdminUploadScores from "./components/AdminUploadScores";
import AdminToolsPage from "./components/AdminToolsPage"; // ✅ if exists
import AdminWinnersPage from "./components/AdminWinnersPage";

// Player/Admin Views
import AllPlayersPicksPage from "./components/AllPlayersPicksPage";
import PlayerRosterPaymentsPage from "./components/PlayerRosterPaymentsPage";
import CumulativeResultsPage from "./components/CumulativeResultsPage";
import ScoredPicksPage from "./components/ScoredPicksPage";
import WeeklyScoresPage from "./components/WeeklyScoresPage";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <div className="App">
        {isLoggedIn && (
          <nav style={{ marginBottom: "20px" }}>
            <ul style={{ listStyle: "none", padding: 0, display: "flex", gap: "15px", flexWrap: "wrap" }}>
              <li><Link to="/player-picks">Player Picks</Link></li>
              <li><Link to="/place-picks">Place Picks</Link></li>
              <li><Link to="/print/week/1">Printable Page</Link></li>
              <li><Link to="/admin/upload">Upload Spreads</Link></li>
              <li><Link to="/admin/approve">Approve Games</Link></li>
              <li><Link to="/admin/upload-scores">Upload Scores</Link></li>
              <li><Link to="/results/week/1">Results Page</Link></li>
              <li><Link to="/scores/week/1">Score Page</Link></li>
              <li><Link to="/admin/tools">Admin Tools</Link></li>
              <li><Link to="/admin/winners">Admin Winners</Link></li>
              <li><Link to="/all-players">All Players Picks</Link></li>
              <li><Link to="/roster-payments">Roster / Payments</Link></li>
              <li><Link to="/cumulative-results">Cumulative Results</Link></li>
              <li><Link to="/scored-picks">Scored Picks</Link></li>
              <li><Link to="/weekly-scores">Weekly Scores</Link></li>
              <li><Link to="/chat">Chat Page</Link></li>
            </ul>
          </nav>
        )}

        <Routes>
          <Route path="/" element={<IntroPage setIsLoggedIn={setIsLoggedIn} />} />
          <Route path="/player-picks" element={<PlayerPicksPage />} />
          <Route path="/place-picks" element={<PlaceYourPicks />} />
          <Route path="/print/week/:weekNumber" element={<PrintableGamesPage />} />
          <Route path="/admin/upload" element={<AdminUploadTool />} />
          <Route path="/admin/approve" element={<AdminApproveGamesPage />} />
          <Route path="/admin/upload-scores" element={<AdminUploadScores />} />
          <Route path="/results/week/:weekNumber" element={<ResultsPage />} />
          <Route path="/scores/week/:weekNumber" element={<ViewScoresPage />} />
          <Route path="/admin/tools" element={<AdminToolsPage />} />
          <Route path="/admin/winners" element={<AdminWinnersPage />} />
          <Route path="/all-players" element={<AllPlayersPicksPage />} />
          <Route path="/roster-payments" element={<PlayerRosterPaymentsPage />} />
          <Route path="/cumulative-results" element={<CumulativeResultsPage />} />
          <Route path="/scored-picks" element={<ScoredPicksPage />} />
          <Route path="/weekly-scores" element={<WeeklyScoresPage />} />
          <Route path="/chat" element={<ChatPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
